INSERT INTO dich_vus (maDV, tenDV, moTa, anh, maLoaiDV, xepLoai, sdtDV, diaChiDV, created_at, updated_at) VALUES
('DV000001', 'Vinpearl Condotel Beachfront Nha Trang', '78 - 80 Đường Trần Phú, Phường Lộc Thọ, Tp. Nha Trang, tỉnh Khánh Hòa', 'picture.png', 'LDV000001', 4.50, '02583599099', '78 - 80 Đường Trần Phú, Phường Lộc Thọ, Tp. Nha Trang, tỉnh Khánh Hòa', NULL, '2023-11-14 22:40:47'),
('DV000002', 'Vinpearl Resort Nha Trang', 'Vinpearl Resort Nha Trang chào đón du khách bằng vẻ đẹp Á Đông thuần khiết với kiến trúc mang đậm phong cách Indochine sang trọng cùng bãi biển riêng tư hút mắt. Giữa vạn trải nghiệm sôi nổi, tại quần thể nghỉ dưỡng – giải trí biển hàng đầu khu vực của đảo Hòn Tre Nha Trang', 'picture.jpg', 'LDV000001', 4.00, '2583598222', 'Đảo Hòn Tre, Tp. Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 22:41:43'),
('DV000003', 'Vinpearl Luxury Nha Trang', 'Đảo Hòn Tre, Tp. Nha Trang, Khánh Hòa, Việt Nam', 'picture.jpg', 'LDV000001', 5.00, '2583582229', 'Đảo Hòn Tre, Tp. Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 22:42:26'),
('DV000004', 'Vinpearl Discovery Golflink Nha Trang test', 'Tọa lạc trên thung lũng ở vị trí tuyệt đẹp ôm trọn điểm ngắm toàn cảnh sân golf 18 hố tiêu chuẩn quốc tế, Vinpearl Discovery Golflink Nha Trang là khu nghỉ dưỡng liền kề sân golf trên đảo đẹp bậc nhất Việt Nam. Đây chính là điểm đến lý tưởng cho những người ưa thích phong cách nghỉ dưỡng đẳng cấp gắn liền với các hoạt động thể thao giàu tính trí tuệ và đam mê mãnh liệt trong hành trình du lịch Nha Trang. Vinpearl Discovery Golflink Nha Trang được thiết kế đầy tính nghệ thuật, lấy cảm hứng từ phong cách kiến trúLDVVc Địa Trung Hải với mái vòm đặc trưng, 182 căn villa với bể bơi riêng biệt, trang bị đầy đủ nội thất, thiết kế hiện đại, cao cấp theo tiêu chuẩn quốc tế. Khu nghỉ dưỡng chắc chắn sẽ thỏa mãn những người yêu mến sự khoáng đạt.', 'picture.jpg', 'LDV000001', 4.50, '02583599099', 'Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 22:43:36'),
('DV000005', 'Melia Vinpearl Empire Nha Trang', 'Chỉ cách sân bay 15 phút lái xe và cách danh thắng Ngũ Hành Sơn 800m, Vinpearl Resort & Spa Đà Nẵng tọa lạc nơi bãi biển Non Nước – \"Bãi biển hấp dẫn nhất hành tinh\" do tạp chí Forbes từng bình chọn. Trong bức tranh sơn thủy hữu tình, Vinpearl Resort & Spa Đà Nẵng tựa ốc đảo thanh bình với 122 căn biệt thự phong cách tân cổ điển được ôm ấp bởi hồ nước lượn quanh và khuôn viên rực rỡ hoa trái. Nơi đây lý tưởng để nghỉ dưỡng thảnh thơi và thuận tiện để khám phá các điểm đến nổi tiếng như Ngũ Hành Sơn, phố cổ Hội An, VinWonders Nam Hội An...', 'picture.jpg', 'LDV000001', 5.00, '02583599099', '44 – 46 Đường Lê Thánh Tôn, phường Lộc Thọ, thành phố Nha Trang', NULL, '2023-11-14 22:43:50'),
('DV000006', 'Vinpearl Resort & Spa Nha Trang Bay Bay', 'Trên “đảo thiên đường” Hòn Tre, Vinpearl Resort & Spa Nha Trang Bay với kiến trúc hình cánh cung trắng muốt luôn hút mắt với vẻ tinh khôi riêng biệt. Mỗi phòng nghỉ đều sở hữu view biển sống động đặc trưng vào lúc bình minh. Thiết kế khung cửa toàn kính bao quanh các căn biệt thự liền kề bờ cát trắng mịn mang tới trải nghiệm “thức giấc ngay giữa bãi biển riêng tư”. Trải nghiệm đặc trưng tại đây là một liệu trình thư giãn trên mặt hồ yên ả, thưởng thức bữa tối trong khung cảnh hoàng hôn tại nhà hàng Lagoon hay thả mình trên ghế lười xem bộ phim yêu thích tại Beach Cinema.', 'picture.jpg', 'LDV000001', 4.50, '0258359099', 'Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 22:44:10'),
('DV000007', 'Vinpearl Discovery Rockside Nha Trang', '78 - 80 Đường Trần Phú, Phường Lộc Thọ, Tp. Nha Trang, tỉnh Khánh Hòa', 'picture.jpg', 'LDV000001', 4.50, '0842583598', '78 - 80 Đường Trần Phú, Phường Lộc Thọ, Tp. Nha Trang, tỉnh Khánh Hòa', NULL, '2023-11-14 22:45:20'),
('DV000009', 'Nha Trang Marriott Resort & Spa', 'Số 7 Trường Sa, Ngũ Hành Sơn, Nha Trang', 'picture.jpg', 'LDV000001', 4.50, '0111222333', 'Số 7 Trường Sa, Ngũ Hành Sơn, Nha Trang', NULL, '2023-11-14 22:47:12'),
('DV000010', 'Melia Vinpearl Cua Sot Beach Resort', 'Vinpearl Discovery Greenhill Phú Quốc sở hữu các biệt thự nép mình dọc theo sườn núi với tầm nhìn khoáng đạt bao trọn cả đất trời. Hồ điều hòa nước ngọt rộng 17 ha nằm ở trung tâm khu nghỉ dưỡng tạo không khí trong lành và cảnh quan độc đáo, thích hợp với những vị khách yêu thích khám phá cảnh sắc thiên nhiên xen kẽ giữa đại dương bao la và núi đồi trùng điệp.\r\n\r\nMột trong những điểm nhấn của Vinpearl Discovery Greenhill Phú Quốc là các Clubhouse The Forest và Nerin thiết kế theo phong cách “tropical” ấn tượng với rừng cây nhiệt đới xanh mướt phủ quanh lối vào, tại đây du khách có thể thỏa thích check-in, thưởng thức những món ăn thượng hạng bao gồm cả đặc sản Phú Quốc và các loại đồ uống hấp dẫn.', 'picture.jpg', 'LDV000001', 4.50, '0258359099', 'Nha Trang, Khánh Hòa', NULL, '2023-11-14 22:47:38'),
('DV000011', 'Vinpearl Landmark 81, Autograph Collection', 'Vinpearl Condotel Beachfront Nha Trang với những căn hộ khách sạn có tầm nhìn hướng biển, không chỉ mang đến cho du khách sự tiện nghi, thoải mái, mà còn là cảm nhận trọn vẹn về những bãi biển đầy nắng gió của vịnh Nha Trang - một trong những vịnh biển đẹp nhất hành tinh. Đây là một điểm đến mới “tất cả trong một” với trung tâm thương mại sầm uất, những nhà hàng sang trọng, bể bơi ngoài trời ngắm toàn cảnh vịnh biển, không gian hội họp đẳng cấp, nơi tụ hội của thành công.', 'picture.jpg', 'LDV000001', 4.50, '02583599099', 'Nha Trang Khánh Hòa', NULL, '2023-11-14 22:47:58'),
('DV000012', 'VinHolidays Fiesta Nha Trang', 'Vinpearl Condotel Beachfront Nha Trang với những căn hộ khách sạn có tầm nhìn hướng biển, không chỉ mang đến cho du khách sự tiện nghi, thoải mái, mà còn là cảm nhận trọn vẹn về những bãi biển đầy nắng gió của vịnh Nha Trang - một trong những vịnh biển đẹp nhất hành tinh. Đây là một điểm đến mới “tất cả trong một” với trung tâm thương mại sầm uất, những nhà hàng sang trọng, bể bơi ngoài trời ngắm toàn cảnh vịnh biển, không gian hội họp đẳng cấp, nơi tụ hội của thành công.', 'picture.jpg', 'LDV000001', 4.50, '02583599099', 'Nha Trang Khánh Hòa', NULL, '2023-11-14 22:48:31'),
('DV000013', 'Four Points by Sheraton Nha Trang', 'Vinpearl Condotel Beachfront Nha Trang với những căn hộ khách sạn có tầm nhìn hướng biển, không chỉ mang đến cho du khách sự tiện nghi, thoải mái, mà còn là cảm nhận trọn vẹn về những bãi biển đầy nắng gió của vịnh Nha Trang - một trong những vịnh biển đẹp nhất hành tinh. Đây là một điểm đến mới “tất cả trong một” với trung tâm thương mại sầm uất, những nhà hàng sang trọng, bể bơi ngoài trời ngắm toàn cảnh vịnh biển, không gian hội họp đẳng cấp, nơi tụ hội của thành công.', 'picture.jpg', 'LDV000001', 4.50, '02583599099', 'Nha Trang Khánh Hòa', NULL, '2023-11-14 22:48:49'),
('DV000014', 'Sheraton Can Tho', 'Nha Trang Khánh Hòa', 'picture.jpg', 'LDV000001', 4.50, '02583599099', 'Nha Trang Khánh Hòa', NULL, '2023-11-14 22:49:24'),
('DV000015', 'Luke Bar', 'Tọa lạc bên bãi biển mang đầy màu sắc tươi trẻ, hiện đại, Luke Bar thu hút du khách với quầy bar sôi động cùng những ly cocktail hấp dẫn, nước ép, trái cây tươi miền nhiệt đới và các loại café thơm ngon...', 'picture.jpg', 'LDV000002', 5.00, '19000006677', 'Water World, VinWonders Nha Trang', NULL, '2023-11-14 22:49:46'),
('DV000016', 'Yummy Land', 'Nhà hàng fastfood Yummy Land phục vụ những món ăn nhanh kiểu Á như: cơm phần, mỳ xào hải sản… và kiểu Âu như burger, pizza hải sản… giúp du khách tái tạo năng lượng để tiếp tục vui chơi và khám phá thế giới giải trí đầy hấp dẫn của Vinwonders Nha Trang.\r\n\r\nVới sức chứa 250 chỗ, nhà hàng Yummy Land là sự lựa chọn hoàn hảo cho mọi du khách với thực đơn đa dạng, hương vị thơm ngon đặc sắc, lên món nhanh và không phải mất nhiều thời gian chờ đợi.', 'picture.jpg', 'LDV000002', 5.00, '1900006677', 'Adventure Land, VinWonders Nha Trang', NULL, '2023-11-14 22:50:07'),
('DV000017', 'Lotteria Restaurent', 'Giới thiệu về Nhà hàng Lotteria\r\nChuỗi nhà hàng được đông đảo các bạn nhỏ yêu thích với các món ăn đặc trưng: gà rán, phomai que, khoai tây chiên…', 'picture.jpg', 'LDV000002', 4.50, '1900556677', 'Sea World, VinWonders Nha Trang | King Garden, Vinwonders Nha Trang', NULL, '2023-11-14 22:50:27'),
('DV000018', 'Yummy Land Restaurent', 'Nhà hàng fastfood Yummy Land - nơi mang đến cho du khách những món ăn kiểu Á như: cơm phần, mỳ xào hải sản… và kiểu Âu như burger, pizza hải sản… để du khách nhanh chóng tái tạo năng lượng, tiếp tục vui chơi và khám phá thế giới giải trí đầy hấp dẫn của Vinwonders Nha Trang.\r\n\r\nVới sức chứa 250 chỗ ngồi, nhà hàng Yummy Land là sự lựa chọn hoàn hảo cho mọi du khách với thực đơn đa dạng, phục vụ nhanh chóng, tận tâm và không làm mất nhiều thời gian chờ đợi.', 'picture.jpg', 'LDV000002', 4.50, '1900006677', 'Water World, VinWonders Nha Trang', NULL, '2023-11-14 22:50:50'),
('DV000019', 'Romy Cream', 'Water World, VinWonders Nha Trang', 'picture.jpg', 'LDV000002', 5.00, '1900667700', 'Water World, VinWonders Nha Trang', NULL, '2023-11-14 22:51:48'),
('DV000020', 'Lobby Bar - Vinpearl Discovery Rockside Nha Trang', 'Vinpearl Discovery Rockside Nha Trang, Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', 'picture.jpg', 'LDV000002', 5.00, '02583598888', 'Vinpearl Discovery Rockside Nha Trang, Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 22:52:49'),
('DV000021', 'Marina Restaurant', 'Tọa lạc tại tầng trệt của khách sạn Vinpearl Resort & Spa Nha Trang Bay, Nhà hàng Marina được bài trí pha trộn giữa nét đẹp hiện đại và truyền thống. Thực khách sẽ được phục vụ buổi tiệc Buffet đa dạng và phong phú từ các đặc sản Việt Nam và Quốc Tế được chế biến qua bàn tay của đầu bếp mang đẳng cấp 5* chắc chắn sẽ mang đến trải nghiệm tuyệt vời.', 'picture.jpg', 'LDV000002', 5.00, '09258598888', 'Vinpearl Resort & Spa Nha Trang Bay, Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:02:17'),
('DV000022', 'Ozone Seafood Restaurant', 'Nhà hàng hải sản Ozone chinh phục những thực khách sành sỏi bằng nguồn hải sản tươi ngon, kết hợp với sự chăm chút chi tiết cho từng món ăn của các chuyên gia ẩm thực cùng với không gian kiến trúc độc đáo, phóng khoáng.\r\nKhi đến với Ozone, quý khách đừng quên thưởng thức những món ăn “sơn hào hải vị” tươi ngon cùng với 17 loại nước sốt trứ danh làm nên đẳng cấp nhà hàng hải sản 5*.', 'picture.jpg', 'LDV000002', 5.00, '84258598888', 'Imperial Club, Đảo Hòn Tre, Tp. Nha Trang, Tỉnh Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:02:48'),
('DV000023', 'Blue Lagoon Restaurant', 'Đến với khách sạn Nha Trang, Quý khách sẽ được thưởng thức những hương vị ẩm thực nổi tiếng trên khắp 4 phương trong không gian sang trọng, hiện đại và khung cảnh thơ mộng, nên thơ của Blue Lagoon Restaurant.', 'picture.jpg', 'LDV000002', 4.50, '842583598598', 'Vinpearl Luxury Nha Trang, Đảo Hòn Tre, Tp. Nha Trang, Tỉnh Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:03:12'),
('DV000024', 'Huong Viet Restaurant', 'Huong Viet Restaurant được đặt tại tầng 1 tòa nhà đón tiếp, với sức chứa lên tới 120 khách. Nhà hàng mang tới cho bạn ẩm thực thuần Việt độc đáo, bao gồm nhiều món đặc sản Nha Trang, với không gian được thiết kế ấn tượng hoàn toàn bằng gỗ lim, có sự kết hợp hài hòa giữa phong cách kiến trúc truyền thống và lối kiến trúc hiện đại.', 'picture.jpg', 'LDV000002', 4.50, '842583598598', 'Vinpearl Luxury Nha Trang, Đảo Hòn Tre, Tp. Nha Trang, Tỉnh Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:03:33'),
('DV000025', 'Beach Bar - Vinpearl Luxury Nha Trang', 'Vinpearl Luxury Nha Trang, Đảo Hòn Tre, Tp. Nha Trang, Tỉnh Khánh Hòa, Việt Nam', 'picture.jpg', 'LDV000002', 5.00, '842583598888', 'Vinpearl Luxury Nha Trang, Đảo Hòn Tre, Tp. Nha Trang, Tỉnh Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:04:32'),
('DV000026', 'Wave Bar', 'Tại Wave Bar, được đắm mình trong không gian sóng biển rì rào với những ly cocktail ngon tuyệt, cùng ngắm ánh hoàng hôn với người mình yêu sẽ là những khoảnh khắc tuyệt vời trong hành trình du lịch Nha Trang.', 'picture.jpg', 'LDV000002', 5.00, '842583598888', 'Vinpearl Luxury Nha Trang, Đảo Hòn Tre, Tp. Nha Trang, Tỉnh Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:03:54'),
('DV000027', 'Pool Bar - Vinpearl Resort Nha Trang', 'Nha Trang - Khánh Hòa', 'picture.jpg', 'LDV000002', 5.00, '842583598598', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:06:02'),
('DV000028', 'Beachcomber - Vinpearl Resort Nha Trang', 'Vinpearl Resort Nha Trang, Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', 'picture.jpg', 'LDV000002', 4.50, '842583598888', 'Vinpearl Resort Nha Trang, Đảo Hòn Tre, Nha Trang, Khánh Hòa, Việt Nam', NULL, '2023-11-14 23:06:46'),
('DV000029', 'Club Lounge', 'Club Lounge tọa lạc tại Vinpearl Resort & Spa Long Beach Nha Trang là nơi mang tới cho quý khách những buổi tối sôi động, mới lạ với những thức uống độc đáo, thức ăn nhẹ thơm ngon khiến những buổi tối trở nên \"chill\" hơn bao giờ hết.', 'picture.jpg', 'LDV000002', 5.00, '842583991888', 'Vinpearl Resort & Spa Long Beach Nha Trang, Lô D6B2 & D7A1, Khu 2, Bắc Bán đảo Cam Ranh, Huyện Cam Lâm, Tỉnh Khánh Hòa', NULL, '2023-11-14 23:07:21'),
('DV000030', 'VinWonders Nha Trang', 'Bước qua cánh cổng của VinWonders Nha Trang là dấn thân vào một cuộc chu du kỳ thú vòng quanh thế giới của niềm vui, sự sôi động và cảm xúc thăng hoa bất tận ở 6 phân khu trò chơi đặc sắc! \r\n\r\nĐến với VinWonders Nha Trang, du khách sẽ được trải nghiệm Cáp treo Thiên đường dài hơn 3.300m tại một trong 29 vịnh biển đẹp nhất hành tinh, “Quẩy” tưng bừng tại Vịnh phao nổi hơn 4.200m2 lớn nhất thế giới! Ngất ngây trên độ cao 120m với Bánh xe bầu trời - Top 10 vòng xoay cao nhất thế giới. Du hành Alpine Coaster dài đến 1.865m - Đường trượt núi trên đảo đầu tiên tại Châu Á.\r\n\r\nKhám phá bộ sưu tập xương rồng lớn nhất Việt Nam cùng các kì hoa dị thảo 5 châu tại The World Garden. Thả mình trên Zipline 880m với Hattrick 03 kỷ lục Dài nhất, Dốc nhất, Cú nhảy tiếp đất cao nhất Việt Nam.', 'picture.jpg', 'LDV000003', 5.00, '842583598888', 'Đảo Hòn Tre, Vĩnh Nguyên, Thành phố Nha Trang, tỉnh Khánh Hoà', NULL, '2023-11-14 23:07:41'),
('DV000031', 'Vinpearl Submarine Nha Trang', 'Là tàu ngầm trong suốt 360 độ đầu tiên trên thế giới cùng thiết kế thân vỏ tàu độc đáo 100% acrylic trong suốt, Vinpearl Submarine Nha Trang mang đến cho du khách trải nghiệm có 1-0-2 với tầm nhìn vô cực, hòa mình trọn vẹn vào không gian sâu thẳm và huyền diệu của đại dương', 'picture.jpg', 'LDV000003', 5.00, '09925838222', 'Đảo Hòn Tre, Vĩnh Nguyên, Thành phố Nha Trang, Tỉnh Khánh Hoà', NULL, '2023-11-14 23:08:00'),
('DV000032', 'Vinpearl Discovery CNTT Nha Trang', 'Nha TRang', 'picture.jpg', 'LDV000001', 4.50, '0345324789', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:10:30'),
('DV000033', 'Vinpear Resort Nha Trang', 'Nha Trang - Khánh Hòa', 'picture.jpg', 'LDV000002', 4.50, '0435432346', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:11:19'),
('DV000035', 'Vinpearl Lovely Nha Trang', 'Nha Trang', 'picture.jpg', 'LDV000003', 4.50, '0123213218', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:12:42'),
('DV000036', 'Vinpearl Earth Nha Trang', 'Nha Trang', 'picture.jpg', 'LDV000001', 5.00, '0345324789', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:13:19'),
('DV000037', 'Vinpearl Hot Nha Trang', 'Nha Trang- Khánh Hòa', 'picture.jpg', 'LDV000001', 4.50, '0345324789', 'Nha Trang- Khánh Hòa', NULL, '2023-11-14 23:14:03'),
('DV000038', 'Vinpearl Alien NHa Trang', 'Vinpearl Resort Nha Trang chào đón du khách bằng vẻ đẹp Á Đông thuần khiết với kiến trúc mang đậm phong cách Indochine sang trọng cùng bãi biển riêng tư hút mắt. Giữa vạn trải nghiệm sôi nổi, tại quần thể nghỉ dưỡng – giải trí biển hàng đầu khu vực của đảo Hòn Tre, Vinpearl Resort Nha Trang là thiên đàng trú ẩn yên bình dành cho những ai yêu thích nghỉ dưỡng và chăm sóc sức khỏe, là nơi để phục hồi năng lượng cho những tâm hồn sôi nổi yêu giải trí và khám phá, nơi ghi dấu hạnh phúc bằng một đám cưới trong mơ, hay hội họp đẳng cấp để dẫn lối tới thành công.', 'picture.jpg', 'LDV000002', 4.50, '0345324789', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:14:35'),
('DV000039', 'Vinpearl Beautiful Nha Trang', 'Nha TRang', 'picture.jpg', 'LDV000003', 4.50, '0345324789', 'Nha TRang - Khánh Hòa', NULL, '2023-11-14 23:20:03'),
('DV000041', 'Vinpearl Golf Nha Trang', 'Nha Trang', 'picture.jpg', 'LDV000004', 5.00, '0258590919', 'Nha Trang - Khánh Hòa', NULL, '2023-11-14 23:15:41');
